const OptionsStyle = {
  body: {
    display: "block",
    backgroundColor: "black",
    width: "150px",
    height: "100px",
    position: "absolute",
    left: "31%",
    top: "63px",
  },
  ul: {
    listStyle: "none",
    paddingLeft: "10px",
  },
  li: {
    paddingLeft: "0px",
    textAlign: "left",
    paddingTop: 5,
    cursor: "pointer",
  },
};

export default OptionsStyle;
